import logo from "./logo.svg";
import "./App.css";
import firebase from "firebase";
import {app} from "./base" 
import { useState } from "react";
import { Route, Switch, BrowserRouter } from "react-router-dom";
import HomePage from "./components/HomePage";
import Country from "./components/Country";
import { Paper } from "@material-ui/core";


// Firebase location imports
const storage = app.storage();


function App() {

  const [png, setpng] = useState("");
  const [title, setTitle] = useState("initialState");
  var pathReference = storage.ref("");

  // Get the Icon from the Firebase for the setpng
  pathReference
    .child("coronavirus.png")
    .getDownloadURL()
    .then(function (url) {
      setpng(url);
    })
    .catch(function (error) {
      console.log(error)
    });
  pathReference
    .child("coronavirus.png")
    .getDownloadURL()
    .then(function (url) {
      setTitle(url);
    })
    .catch(function (error) {
      console.log(error)
    });

  return (
    <div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          flexDirection: "row",
        }}
      >
        <img
          src={png}
          style={{ width: "50px", height: "50px", margin: "10px" }}
        />
        <img
          src={title}
          style={{ height: "50px", margin: "10px 10px 10px -10px" }}
        />
      </div>
      <Paper elevation={2} style={{padding:'1% 0', margin:'2% 15%',}}>
      <BrowserRouter>
        <Switch>
          <Route exact path="/" render={(props) => <HomePage {...props} />} />
          <Route
            exact
            path="/country"
            render={(props) => <Country {...props} />}
          />
        </Switch>
      </BrowserRouter>
      </Paper>
    </div>
  );
}

export default App;
